import logo from './logo.svg';
import './App.css';
import LoginForm from './loginForm';


function App() {
  return (
    <div className="App">
      <h1>Gevera</h1>
      <LoginForm />
      <Routes>
      <Route path='/' element={<h1>Home Page Component</h1>} />
      <Route path='login' element={<h1>Login Page Component</h1>} />
      </Routes>
    </div>
  )

}

export default App;
